script: |
  super -f text -I q4371.spq | sort > q4371.out

inputs:
  - name: q4371.spq
    data: |
      SELECT DISTINCT + col1 * + col0 * - col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN 50 * - ( + col1 ) - + col0 * + 64 + 82 AND - col2;
  - name: tab2

outputs:
  - name: q4371.out
    data: |
